            <div className="absolute -top-32 right-1/4 w-1 h-32 bg-orange-300 transform rotate-12 origin-top"></div>

            {/* Hanging Card */}
            <div className="grid grid-cols-1 md:grid-cols-2 gap-8 items-center bg-gradient-to-br from-orange-400 via-amber-400 to-orange-500 p-8 rounded-xl shadow-lg backdrop-blur-sm relative overflow-hidden">
